import React, { useState, useEffect } from "react";
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import { useNavigate, Outlet } from "react-router-dom";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import axios from 'axios'

function laptopData() {
  useEffect(() => {
    axios.get('http://localhost:8081/laptopspecs').then((result) => {
      <Card>
        <Card.Img variant="top" src="/logo192.png" />
        <Card.Body>
          <Card.Title>LG Ultra PC</Card.Title>
          <Card.Text>
            <div className="cardstyle">
              <li>CPU : {result.data[0].CPU}</li>
              <li>RAM : {result.data[0].RAM}</li>
              <li>SSD : {result.data[0].SSD}</li>
              <li>HDD : {result.data[0].HDD}</li>
            </div>
          </Card.Text>
          <Button variant="primary" onClick={() => { navigate('/home/detail') }}>상세정보</Button>
          <Button variant="primary" onClick={() => {
            //console.log(laptopData)
          }}>데이터받아오기</Button>
        </Card.Body>
      </Card>
    }).catch(() => {
      console.log('failed')
    })
  }, [])
}

function Home() {
  const navigate = useNavigate();

  return (
    <div>
      <Container>
        <Row xs={1} md={3} className="g-5">
          {Array.from({ length: 5 }).map((_, idx) => (
            <Col key={idx}>
              {laptopData()}
            </Col>
          ))}
        </Row>
      </Container>
      <div className="detailComponent">
        <Outlet></Outlet>
      </div>
    </div>
  )
}

export default Home;
